// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

// interface中的所有函式都要加上external，但是在合約實作時可以改成public
interface IERC20 {
    // 發生轉帳時要觸發此事件，即使轉移的數量為0也要觸發
    event Transfer(address indexed from, address indexed to, uint256 value);

    // 發生授權時要觸發此事件，即使轉移的數量為0也要觸發
    event Approval(address indexed owner, address indexed spender, uint256 value);
    // 查詢代幣的發行量，使用狀態變數_totalSupply來儲存，只要在合約裡不會被外人直接看到的變數都會加一個_
    function totalSupply() external view returns(uint256);
    // 給定一個帳戶，查詢裡面的餘額
    // 是address => uint256的關係，會用mapping來儲存
    function balanceOf(address account) external view returns(uint256);

    // 授權數量查詢函式，包含授權者和被授權者，使用兩層mapping: mapping(address => mapping(address => uint256))
    // 授權者授權的數量可以超過他目前總共有的額度，就像銀行授權給你的信用額度可以超出你現有的存款
    // 因為最終第三方可不可以花掉這筆錢還是要看轉帳瞬間授權者的帳戶有沒有足夠金額
    function allowance(address owner, address spender) external view returns(uint256);

    // 授權函式。Ex: 授權理專來操作我的錢，呼叫者授權給spender，授權多少數量    
    function approve(address spender, uint256 amount) external returns(bool);
    // 轉帳函式，預設呼叫的人就是轉帳的發起者，成功回傳true，反之回傳錯誤訊息
    // 檢查帳戶餘額是否足夠支付轉帳金額、轉到0x0這個位置，代幣會被銷毀
    // 0x0大家共識是一個虛無的位置，沒有人有權拿到此位置的私要來操縱他
    function transfer(address to, uint256 amount) external returns(bool);

    // 呼叫者為被授權者(第三方)的轉帳函式，成功回傳true，反之回傳false
    // 處Transfer event時from會是Owner，不是msg.sender
    function transferFrom(address from, address to, uint256 amount) external returns(bool);
}

interface IERC20Metadata {
    // 代幣名稱，通常在constructor時就給定
    function name() external view returns(string memory);
    // 代幣的簡稱，通常會顯示在錢包上，在constructor時就給定
    function symbol() external view returns(string memory);
    // 代幣的小數點位置。EX: decimal = 3, balance = 1234, 實際上數值就是1.234
    // 基本上代幣都會把decimal設為18
    // 1 ether = 10^18 wei
    // 1token = 10^18 unit => decimal = 18
    function decimals() external view returns(uint8);
}

// 代表合約{ERC20}會實作介面{IERC20}
contract ERC20 is IERC20 {
    // 沒有加上public，代表外人不會看到
    uint256 _total_supply;
    mapping(address => uint256) _balance;
    mapping(address => mapping(address => uint256)) _allowance;
    string _name;
    string _symbol;
    function name() external view returns(string memory) {
        return _name;
    }
   
    function symbol() external view returns(string memory) {
        return _symbol;
    }
    // 沒有讀取和寫入 => pure
    function decimals() external pure returns(uint8) {
        return 18;
    }
    constructor() {
        _balance[msg.sender] = 10000;
        _total_supply = 10000;
    }
    function totalSupply() public view returns(uint256){
        return _total_supply;
    }
    function balanceOf(address account) external view returns(uint256){
        return _balance[account];
    }
    // 可以寫一個專門給內部使用的函式，設定為internal
    // 把重複的程式抽離出來變成一個內部函式
    function _transfer(address from, address to, uint256 amount) internal {
        // 檢查授權人的餘額是否足夠這次交易，有點像銀行金融卡的制度
        uint256 my_balance = _balance[from];
        require(my_balance >= amount, "Have not enough money to transfer.");
        require(to != address(0), "Can not transfer to address 0");
        _balance[from] -= amount;
        _balance[to] += amount;
        // 因為有轉帳，要出發Transfer事件
        emit Transfer(from, to, amount);
    }
    function transfer(address to, uint256 amount) external returns(bool) {
        _transfer(msg.sender, to, amount);
        // 通過兩個require才會回傳true
        return true;
    }
    // 寫一個內部函式_approve
    function _approve(address owner, address spender, uint256 amount) internal {
        _allowance[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }
    // 一個擁有者可以授權給很多人
    function allowance(address owner, address spender) public view returns(uint256) {
        return _allowance[owner][spender];
    }
    function approve(address spender, uint256 amount) external returns(bool) {
        _approve(msg.sender, spender, amount);
        return true;
    }
    // from是帳戶持有人，msg.sender是帳戶持有人授權的第三方
    function transferFrom(address from, address to, uint256 amount) public returns(bool) {
        uint256 my_allowance = _allowance[from][msg.sender];
        // 檢查授權金額是否足夠轉帳
        require(my_allowance >= amount, "Your allowance is not enough to do the transfer.");

        _approve(from, msg.sender, my_allowance - amount);
        _transfer(from, to, amount);
        return true;
    } 
}

